{"en_US": "Send one separate email for each invoice.

Any file extension will be accepted.

Only PDF and XML files will be interpreted by Odoo"}

{"en_US": "Code to compute the value of the field.
Iterate on the recordset 'self' and assign the field's value:

    for record in self:
        record['size'] = len(record.name)

Modules time, datetime, dateutil are available."}

{"en_US": "Use these keywords in the title to set new tasks:

            #tags Set tags on the task
            @user Assign the task to a user
            ! Set the task a high priority

            Make sure to use the right format and order e.g. Improve the configuration screen #feature #v16 @Mitchell !"}
